INSERT INTO `index_fulltext` VALUES (9015782,'Congratulations ,This website is a default website setup for TYPO3. You can use it to demonstrate the basic features of the TYPO3 Content Management System, but you are also welcome to use it as a basis for your own website projects. Please have a look at how it works and how it is structured. In building this package, we have tried to combine a lot of best practices. Feel free to use these structures and use elements of it for your own way of working. , typo3, introduction package, install, example setup Let us introduce you to TYPO3,  the leading Open Source CMS at  Enterprise level.                    \n                Start browsing\n               Grab a cup of coffee and start browsing to learn why TYPO3 CMS is the most powerful open source content management system.   Features   Customizing                \n                Example Pages\n               To help get you started with TYPO3 CMS, weve included usage examples of the standard content elements that have made TYPO3 CMS so popular.   Examples                \n                Test the CMS\n               Explore TYPO3 CMS backend and the limitless possibilities of TYPO3 CMS by using one of the predefined users with different levels of access.   Log into TYPO3                              \n                Make it your own\n               This distribution is developed to help you getting an easy entry into TYPO3 CMS. It can be used as an example to play around or to kickstart your own projects.  Included features of the Introduction Package   TYPO3 CMS custom theme for Twitter Bootstrap  All Content Elements mapped to fit Twitter Bootstrap  Example additional content elements for carousel and accordion  All settings editable via the TypoScript constant editor  Responsive images enabled','');
/*!40000 ALTER TABLE `index_fulltext` ENABLE KEYS */;
UNLOCK TABLES;

