achte sich auf den Weg. Als es die ersten Hgel des Kursivgebirges erklommen hatte, warf es einen letzten Blick zurck auf die Skyline seiner Heimatstadt Buchstabhausen, die Headline von Alphabetdorf und die Subline seiner eigenen Strae, der Zeilengasse. Wehmtig lief ihm eine rhetorische Frage ber die Wange, dann setzte es seinen Weg fort. Unterwegs traf es eine Copy. \";s:15:\"l10n_diffsource\";s:1596:\"a:7:{s:6:\"hidden\";i:0;s:9:\"starttime\";i:0;s:7:\"endtime\";i:0;s:6:\"header\";s:11:\"Media Right\";s:8:\"bodytext\";s:1439:\"Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed luctus lorem ut efficitur ultrices. Aliquam efficitur ante non molestie sodales. Nunc ullamcorper tempus diam, ac pretium urna vestibulum sed. Nam placerat nulla in fermentum sagittis. Curabitur eget sapien nec quam egestas faucibus. Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas. Ut a augue sed tellus laoreet porta nec sit amet urna. Duis finibus metus commodo tortor auctor ullamcorper ac sed urna. Praesent interdum, velit ut bibendum vulputate, elit augue congue eros, at egestas nunc arcu non sem. In malesuada semper neque cursus sagittis. Morbi ac risus eu risus mollis ornare consequat eu leo.\r\nDonec lacinia pretium enim, non tristique urna dignissim non. Fusce volutpat, arcu et iaculis lobortis, erat neque rutrum mauris, eu cursus nulla ante in ipsum. Vestibulum sagittis dictum turpis in placerat. Sed mollis finibus nulla sit amet dapibus. Donec blandit, nibh et ultrices efficitur, ligula justo mollis elit, a tincidunt diam neque gravida dolor. Vivamus a turpis sed magna eleifend elementum. Nullam pretium tincidunt mattis. Sed vel felis turpis. Integer sit amet turpis quam. Duis in dapibus augue. In cursus rhoncus velit ut hendrerit. Quisque sit amet est quis quam mattis venenatis. Aliquam diam purus, venenatis ut malesuada ut, venenatis eu sem. Proin a velit dui. In tempus lorem et neque interdum placerat.\";s:5:\"media\";i:1;s:11